  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Seney
  National Wildlife Refuge outlines Refuge accomplishments ending in July of 1938.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover conditions during the year. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, and plants- is also
  covered. The Refuge development and maintenance section discusses physical developments,
  plantings, and collections and receipts. The public relations section of the report
  describes recreational uses. A waterfowl census is included. Photographs are attached.\",\n\t\"license_title\":
